import React from 'react';
import {
  BrowserRouter as Router, 
  Switch, 
  Route, 
  Link
} from 'react-router-dom';
import './App.css';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" component={HomePage} exact/>
        <Route path="/about-me" component={AboutMePage} />
        <Route path="/portfolio" component={PortfolioPage} />

      </Switch>
    </Router>
  );
}

export default App;
